  KEY `account_id` (`account_id`),
  KEY `followed_user_pk` (`followed_user_pk`),
  CONSTRAINT `ibfk_5d173686da8dc` FOREIGN KEY (`user_id`) REFERENCES `np_users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `ibfk_5d173686da8de` FOREIGN KEY (`account_id`) REFERENCES `np_accounts` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=344 DEFAULT CHARSET=latin1;
